const Home = () => {
  return (
    <Helmet title="Trang chá»§">
      {/* hero slide */}
      <HeroSlider
        data={heroSliderData}
        control={true}
        auto={true}
        timeOut={3000}
      />
      {/* end hero silde */}
    </Helmet>
  );
};

export default Home;
